import React from "react";

const Genericpage = ({
    pageName,
    tableHeaderComponent,
    tableInfoComponent,
    editButtonComponent,
    deleteButtonComponent,
    createButtonComponent,
}) => {
    return (
        <section>
            <h2>{pageName}</h2>
            <div className="divTable">
                <div className="headRow">{tableHeaderComponent}</div>
                <div className="divRow">
                    {tableInfoComponent}
                    {editButtonComponent}
                    {deleteButtonComponent}
                </div>
            </div>
            <div>{createButtonComponent}</div>
        </section>
    );
};

export default Genericpage;
